import React, {useEffect, useState} from 'react'
import {StyleSheet, View,FlatList, Text, Button} from 'react-native'
import Part from './Part'

const PartsList = (props) => {

    const [Data, setData] = useState({});
    const [isLoading, setIsLoading] = useState(true);


    //Fetch method for api call
    const FetchData = async(base64String) => {

      await fetch('http://151.236.217.15:5001/api/sparpartimage',{
            method:'POST',
            body:JSON.stringify({image: testBase64}),
            headers:{
                'Content-type': 'application/json; charset=UTF-8',
              },
            })
            .then((response)=>response.json())
            .then((json) => {/*setData(json)*/ console.log(json)})
            .catch((error)=>console.log(error))
            .finally(()=>{setIsLoading(false)});

    }
    const callMeTest = () => {
      console.log('hello');
    }
    useEffect(()=> {
    },[]);

    const renderItem = ({ item }) => (
      <Part object={item} componentId={props.componentId}/>
    );

    const List = <FlatList
            data={Data}
            renderItem={renderItem}
            keyExtractor={(item) => item._id.$oid}
            initialNumToRender={10}
        /> 
    //FetchData(props.base64)
    const loading = <Text>loading....</Text>

    return (
      <View style={[styles.MainWindow,(isLoading) ? styles.loading : null]}>
        <Button title="Press to load data" onPress={()=>{FetchData(props.base64)}}></Button>
        {(isLoading) ? loading : List}
        
      </View>
    );
  };
  
  const styles = StyleSheet.create({
    MainWindow:{
      flex:1,
    },
    loading:{
      justifyContent:'center',
      alignItems:'center',
    }
  });
  
  export default PartsList;
  

